<!doctype html><html lang="en"><head><meta charset="utf-8"/><link rel="icon" href="/Online-Store/favicon.ico"/><meta name="viewport" content="width=device-width,initial-scale=1"/><title>Online Store</title><script defer="defer" src="/Online-Store/static/js/main.2596be9b.js"></script><link href="/Online-Store/static/css/main.f9934ff0.css" rel="stylesheet">
  <script type="text/javascript">
  (function(l) {
    if (l.search[1] === '/' ) {
      var decoded = l.search.slice(1).split('&').map(function(s) { 
        return s.replace(/~and~/g, '&')
      }).join('?');
      window.history.replaceState(null, null,
          l.pathname.slice(0, -1) + decoded + l.hash
      );
    }
  }(window.location))
</script>
  </head>
  <body>
    <div id="root"></div>
  </body>
</html>
